import './homeproducts.scss'
import '../Home-header/HomeHeader.component'
import {Switch, Route, withRouter} from 'react-router-dom';
import HomeHeader from '../Home-header/HomeHeader.component';
import ProductCard from '../Product-Card/ProductCard.component'
import CustomButton from '../../CustomButton/CustomButton.component'
import ProductItem from '../../Products-components/Product-item/Product-item.component'

const HomeProducts = ({productList, history}) => {
    return (
        <div className='home-products'>
        <HomeHeader header={'Products'}/>
            <div className='home-products-content'>
                <div className='product-cards'>
                    {
                        productList.map(({product, image, UrlLink}, index) => {
                            return <ProductCard key={index} name={product} image={image} onClick={() => history.push(`products/${UrlLink}`)}/>
                        })
                    }
                </div>
                
            </div>
            <CustomButton name={'Products'} buttonUrlLink={'/products'}/>
            <Switch>
                <Route path={`products/:productId`}>
                    <ProductItem />
                </Route>
            </Switch>
        </div>
    )
}

export default withRouter(HomeProducts);
